  let mensaje; edad >= 18 ? mensaje = "Eres mayor de edad" : mensaje = "No eres mayor de edad"

  const fecha = new Date().getFullYear()

  return (
    <Fragment>
      <h1>Básicos React</h1>
      <h2>{saludo}</h2>
      <h2>{mensaje}</h2>
      <Header titulo="Tienda virtual" numero={1} />
      <Footer/>
    </Fragment>
  );
}

